<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Open Multiple URLs</title>
</head>

<body>

    <script>
        // List of URLs to open
        var urlsToOpen = [
            'https://www.toprevenuegate.com/eirxku6md?key=fc0749abef9de47a53cf8d216df555ca',
            'https://www.toprevenuegate.com/eirxku6md?key=fc0749abef9de47a53cf8d216df555ca',
            'https://www.toprevenuegate.com/jnetk6gmnz?key=ca33448fda83f95e751cb4b3c0e52563',
            'https://www.toprevenuegate.com/jnetk6gmnz?key=ca33448fda83f95e751cb4b3c0e52563',
            'https://www.toprevenuegate.com/s0krdngk?key=b0722cbe1b91769a94f27e5c599cf23a',
            'https://www.toprevenuegate.com/s0krdngk?key=b0722cbe1b91769a94f27e5c599cf23a',
                 // Add more URLs as needed
        ];

        // Function to open URLs in new tabs
        function openMultipleTabs() {
            urlsToOpen.forEach(function (url) {
                window.open(url, '_blank');
            });
        }

        // Call the function on page load
        window.onload = openMultipleTabs;
    </script>

</body>

</html>
